let currentArtistPage = 0;
let currentConcertPage = 0;


//AJAX in /index
$(document).ready(function() {
    $('#moreArtistButton').click(function() {
        currentArtistPage++;
        var existingCount = $('.listArtist li').length; 

        $.ajax({
            url: '/moreArtists',
            type: 'GET',
            data: { page: currentArtistPage },
            success: function(data) {
                if (data.trim() === '') {
                    $('#moreArtistButton').hide();
                } else {
                    $('.listArtist').append(data);
                }
            },
            error: function() {
                alert('Error al cargar más artistas');
            }
        });
    });
});

//AJAX in /search
$(document).ready(function() {
    $('#moreConcertButton').click(function() {
        currentConcertPage++;
        var existingCount = $('.event-article').length;
        console.log($('.event-article').length, existingCount); 

        $.ajax({
            url: '/moreConcerts',
            type: 'GET',
            data: { page: currentConcertPage },
            success: function(data) {
                if (!data.hasNext)
                    $('#moreConcertButton').hide();
                $('#search-results2').append(data.content);
            },
            error: function() {
                alert('Error al cargar más conciertos');
            }
        });
    });
});


// Delete concert in /search
document.addEventListener("DOMContentLoaded", function() {
  
    const deleteButtons = document.querySelectorAll('.delete-btn');
    
    
    deleteButtons.forEach(button => {
        button.addEventListener('click', function() {
            const concertId = button.getAttribute('data-id');
            const confirmation = confirm('¿Estás seguro de que quieres eliminar este concierto?');
            if (confirmation) {
                fetch(`/search/${concertId}`, {
                    method: 'DELETE'
                })
                .then(response => {
                    if (response.ok) {
                        // Eliminación exitosa, puedes realizar alguna acción adicional si es necesario
                        button.parentNode.remove(); // Eliminar el elemento HTML del concierto eliminado
                        alert('Concierto eliminado correctamente');
                    } else {
                        alert('Hubo un problema al intentar eliminar el concierto.');
                    }
                })
                .catch(error => console.error('Error al eliminar el concierto:', error));
            }
        });
    });
});






function editField(textId, inputId, saveBtnId, editBtnId) {
    var value = document.getElementById(textId).innerText;
    // Hide the text and edit button
    document.getElementById(textId).style.visibility = 'hidden';
    document.getElementById(editBtnId).style.visibility = 'hidden'; // Use the unique ID
    
    // Show the input and save button, ensure they don't disrupt layout
    var inputElement = document.getElementById(inputId);
    var saveBtnElement = document.getElementById(saveBtnId);
    inputElement.style.visibility = 'visible';
    inputElement.style.display = 'inline-block';
    saveBtnElement.style.visibility = 'visible';
    saveBtnElement.style.display = 'inline-block';

    inputElement.value = value;
}

function saveField(textId, inputId, saveBtnId, editBtnId) {
    var newValue = document.getElementById(inputId).value;
    document.getElementById(textId).innerText = newValue;

    // Prepare data to be sent to the server
    var data = { value: newValue };

    // Determine which field is being updated based on the inputId
    var updateUrl = '/user/update/'; // Base URL for update endpoint
    if (inputId === 'nameInput') {
        updateUrl += 'name';
    } else if (inputId === 'emailInput') {
        updateUrl += 'email';
    }

    // Make the POST request using fetch
    fetch(updateUrl, {
        method: 'POST',
        headers: {
            'Content-Type': 'application/json',
            // Include CSRF token as needed for security
        },
        body: JSON.stringify(data)
    }).then(response => {
        if (response.ok) {
            console.log('Update successful');
        } else {
            console.error('Update failed');
        }
    });

    // Revert visibility
    document.getElementById(textId).style.visibility = 'visible';
    document.getElementById(inputId).style.visibility = 'hidden';
    document.getElementById(saveBtnId).style.visibility = 'hidden';
    document.getElementById(editBtnId).style.visibility = 'visible';

    // Optionally revert to display none
    document.getElementById(inputId).style.display = 'none';
    document.getElementById(saveBtnId).style.display = 'none';
}

function previewImage(input) {
    if (input.files && input.files[0]) {
        var reader = new FileReader();

        // Preview the image
        reader.onload = function(e) {
            document.getElementById('profileImage').src = e.target.result;
            // After setting the preview, upload the image
            uploadImage(input.files[0]);
        };

        reader.readAsDataURL(input.files[0]);
    }
}

function uploadImage(file) {
    var formData = new FormData();
    formData.append('imageFile', file); // 'imageFile' is the key

    fetch('/user/update/image', { // Endpoint to upload the image
        method: 'POST',
        body: formData, // Send the image file in FormData
    }).then(response => {
        if (response.ok) {
            console.log('Image uploaded successfully.');
        } else {
            response.text().then(text => console.log(text)); // Show server response text
        }
    }).catch(error => {
        console.error('Error uploading image:', error);
    });
}

function downloadTicket(ticketId, num_ticket, eventName, name, date, time, location) {
    const { jsPDF } = window.jspdf;
    const doc = new jsPDF();

    // PDF Content
    // Include the QR code image
    const qrImg1 = 'data:image/jpeg;base64,'; // Your base64-encoded image string here
    // Assuming you want a 20-point right margin
    const pageWidth = doc.internal.pageSize.getWidth(); // Get the width of the page
    const marginLeft = 10;
    const marginRight = 10; // Desired right margin
    const imageWidth = pageWidth - marginLeft - marginRight; // New image width to respect right margin
    
    doc.addImage(qrImg1, 'PNG', 10, 10); // Adjust width to include right margin
    doc.setFontSize(16);
    doc.text(eventName, 10, 90);
    doc.setFontSize(12);
    doc.text(`Nombre: ${name}`, 10, 100);
    doc.text(`Fecha: ${date}`, 10, 110)
    doc.text(`Hora: ${time}`, 10, 120);
    doc.text(`Lugar: ${location}`, 10, 130);
    doc.text(`Número de entradas: ${num_ticket}`, 10, 140);

    // Include the QR code image
    const qrImg2 = 'data:image/png;base64,'; // Your base64-encoded image string here
    doc.addImage(qrImg2, 'PNG', 10, 150, 50, 50);

    // Trigger PDF download
    doc.save(`ticket-${ticketId}.pdf`);
}